import React from "react";

const Home = () => {
  return (
    <>
      <section id="home" className="home">
        <div className="container-fluid   navitem">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <h1>home page</h1>
                <p>thank you for your viit</p>
                <button>let's go</button>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
